        <p>&nbsp;</p><p>It has long been questioned as to why&nbsp;<a href="https://decryptionary.com/dictionary/bitcoin/" target="_blank">Bitcoin</a>&nbsp;is priced in U.S. dollars when they are two entirely different entities. One is an inherently weak&nbsp;<a href="https://decryptionary.com/dictionary/currency/" target="_blank">currency</a>&nbsp;that has been continuously devalued for almost 50 years, and the other is a mathematically finite&nbsp;<a href="https://decryptionary.com/dictionary/digital/" target="_blank">digital</a>&nbsp;store of value.</p><div class="se-component se-image-container __se__float-right" contenteditable="false"><figure style="margin: auto; width: 400px;"><img src="data:image/jpeg;base64," alt="" data-rotate="0" data-proportion="true" data-size="400px,auto" data-align="right" data-index="0" data-file-name="bugatti-chiron-pur-sport-106-1582836604.jpg" data-file-size="1593612" data-origin="400px,auto" style="width: 400px; height: auto;"></figure></div><p>​</p><p>In a recent blog post by entrepreneur, Sylvain Saurel pointed out that the purchasing power of $1,000 in August 1971 has lost more than 85% of its value in 2020, and is not even worth $150 today.</p><p>Those lofty $1 million Bitcoin price predictions are likely to arrive quicker as the greenback is increasingly devalued. Most are familiar with this now-famous chart (and this does not even include the 2020 economic collapse).</p><p>&nbsp;</p><p>Saurel suggested that gold would be a better alternative to price Bitcoin because it has been a recognized store of value for centuries.</p><h2>Stores of Value Increasing</h2><p>According to Goldprice.org, the precious yellow metal hit an all-time high of $2,070/oz on August 6, and some of it must be attributed to a weakening dollar. The Federal Reserve continues to print trillions to keep the sinking economy afloat, and this will ultimately dissolve investor confidence in the USD as a reserve currency.</p><p>Gold is not the only store of value increasing as the greenback crumbles. Silver is also trading close to a seven-year high, and Bitcoin is up by around 57% since the beginning of the year.</p><p>Bitcoin and gold share several similarities, such as the cost of extraction or&nbsp;<a href="https://decryptionary.com/dictionary/mining/" target="_blank">mining</a>. Dollars, on the other hand, can be created out of thin air as the Fed has duly demonstrated over the past few months. However, it isn’t easy to estimate the supply of gold, whereas, for Bitcoin, it is a known quantity.</p><h2>Bitcoin to $50k</h2><p>Saurel added that pricing Bitcoin in terms of gold would eliminate the inflation associated with fiat currencies, specifically the dollar. It would take in just the prices of the two best stores of value in relation to each other.</p><p>He concluded that the next Bitcoin&nbsp;<a href="https://decryptionary.com/dictionary/bull/" target="_blank">bull</a>&nbsp;<a href="https://decryptionary.com/dictionary/run/" target="_blank">run</a>&nbsp;would see prices hit at least $50k by the end of 2021, or even longer if the current cycle is extended as predicted. By then, the ratio of Bitcoin to an ounce of gold should be between 20 and 50. Although pricing in dollars is not likely to change at any time soon, looking at gold as a comparison will provide a much clearer picture of value for both assets.</p><p>&nbsp;</p> ◀"
